import React, { Component } from 'react'
import { ContentDiv, Content} from '../styles/SideBarStyles'

export class TodoStacks extends Component {
    createStack = (name) => {
        return <Content key={name.key}>{name.text}</Content>    
    }
    
    render() {
        var nameEntries = this.props.entries;
        var listNames = nameEntries.map(this.createStack)
        return (
            <React.Fragment>
                <ContentDiv>
                    {listNames}
                </ContentDiv>
            </React.Fragment>
        )
    }
}

export default TodoStacks
